class PageZoom:
    '''
    Specifies type of page zoom.
    '''
    
    # Keep unchanged
    Retain = 'retain'

    # Fit page in window
    FitPage = 'fitPage'

    # Fit width of page in window
    FitWidth = 'fitWidth'

    # Fit height of page in window
    FitHeight = 'fitHeight'

    # Fit all elements of page in window
    FitBox = 'fitBox'